import React from 'react';
import './Main.css';
import Product from '../components/Product';
import images from '../images/acrap.jpg'

function Main() {

  const products = [
    { id: 1, header: 'Товар 1', images: images, price: 120 },
    { id: 2, header: 'Товар 2', images: images, price: 2990 },
    { id: 3, header: 'Товар 3', images: images, price: 3990 },
    { id: 4, header: 'Товар 4', images: images, price: 49900 },
    { id: 5, header: 'Товар 5', images: images, price: 599 },
    { id: 6, header: 'Товар 6', images: images, price: 69900 },
    { id: 7, header: 'Товар 7', images: images, price: 799 },
    { id: 8, header: 'Товар 8', images: images, price: 99900 }
  ]

  function getProductList(){
    return products.map((item) => <Product  key={item.id} header={item.header} images={images} price={item.price} /> )
  }

  return (
    <div className="Main">
      { getProductList() }
    </div>
  );
}

export default Main;
